import * as React from 'react';
import { Text, View } from 'react-native';





function Portfolio() {
    return (
        <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
            <Text>dablu gupta</Text>

        </View>
    );
}

export default Portfolio;
